import React from "react";
import DateHandler from "../../Utility/DateHandler";
import classes from "./StudentProfileInfoTable.module.css";

const StudentProfileInfoTable = (props) => {
  return (
    <div>
      <div className={classes.title}>Student Personal Information Page</div>
      <table>
        <thead>
          <tr>
            <th>First name</th>
            <th>Last name</th>
            <th>Date of birth</th>
            <th>Email</th>
            <th>Specialization</th>
          </tr>
        </thead>
        <tbody>
          <tr>
            <td>{props.user.firstName}</td>
            <td>{props.user.lastName}</td>
            <td></td>
            <td>{props.user.email}</td>
            <td>{props.user.specialization}</td>
          </tr>
        </tbody>
      </table>
    </div>
  );
};

export default StudentProfileInfoTable;
